package com.vrv.cems.service.cache.bean;

import java.util.List;

import com.vrv.cems.service.base.bean.cache.ProductInfoNew;
import com.vrv.cems.service.base.bean.cache.ProductInfoOld;

public class DeviceProductBean {
	

	/**
	 * 设备操作系统类型
	 */
	private String osType;
	/**
	 * 产品类型
	 */
	private String productType;
	/**
	 * 已安装产品属性
	 */
	public List<ProdInfoOldBean> productInfoOld;
	/**
	 * 应安装产品属性
	 */
	public List<ProdInfoNewBean> productInfoNew;

	
	public DeviceProductBean() {
		super();
	}


	public DeviceProductBean(String osType, String productType,
			List<ProdInfoOldBean> productInfoOld,
			List<ProdInfoNewBean> productInfoNew) {
		super();
		this.osType = osType;
		this.productType = productType;
		this.productInfoOld = productInfoOld;
		this.productInfoNew = productInfoNew;
	}


	public String getOsType() {
		return osType;
	}


	public void setOsType(String osType) {
		this.osType = osType;
	}


	public String getProductType() {
		return productType;
	}


	public void setProductType(String productType) {
		this.productType = productType;
	}


	public List<ProdInfoOldBean> getProductInfoOld() {
		return productInfoOld;
	}


	public void setProductInfoOld(List<ProdInfoOldBean> productInfoOld) {
		this.productInfoOld = productInfoOld;
	}


	public List<ProdInfoNewBean> getProductInfoNew() {
		return productInfoNew;
	}


	public void setProductInfoNew(List<ProdInfoNewBean> productInfoNew) {
		this.productInfoNew = productInfoNew;
	}



	
}
